import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import { ChartBar, Users, CreditCard, GraduationCap, Target, LogIn, LogOut, UserPlus } from 'lucide-react';
import Home from './components/Home';
import Education from './components/Education';
import LendingCircle from './components/LendingCircle';
import Marketplace from './components/Marketplace';
import CreditScore from './components/CreditScore';
import FinancialGoals from './components/FinancialGoals';
import Login from './components/Login';
import Register from './components/Register';
import { AuthProvider, useAuth } from './context/AuthContext';

const Navigation = () => {
  const { user, logout } = useAuth();

  return (
    <nav className="bg-blue-600 text-white p-4">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-2xl font-bold">InclusiveFin</Link>
        <ul className="flex space-x-4">
          <li><Link to="/" className="hover:text-blue-200"><Home className="inline-block mr-1" size={18} /> Home</Link></li>
          <li><Link to="/education" className="hover:text-blue-200"><GraduationCap className="inline-block mr-1" size={18} /> Education</Link></li>
          <li><Link to="/lending-circle" className="hover:text-blue-200"><Users className="inline-block mr-1" size={18} /> Lending Circle</Link></li>
          <li><Link to="/marketplace" className="hover:text-blue-200"><ChartBar className="inline-block mr-1" size={18} /> Microgrants</Link></li>
          <li><Link to="/credit-score" className="hover:text-blue-200"><CreditCard className="inline-block mr-1" size={18} /> Credit Score</Link></li>
          <li><Link to="/financial-goals" className="hover:text-blue-200"><Target className="inline-block mr-1" size={18} /> Financial Goals</Link></li>
          {user ? (
            <li><button onClick={logout} className="hover:text-blue-200"><LogOut className="inline-block mr-1" size={18} /> Logout</button></li>
          ) : (
            <>
              <li><Link to="/login" className="hover:text-blue-200"><LogIn className="inline-block mr-1" size={18} /> Login</Link></li>
              <li><Link to="/register" className="hover:text-blue-200"><UserPlus className="inline-block mr-1" size={18} /> Register</Link></li>
            </>
          )}
        </ul>
      </div>
    </nav>
  );
};

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <div className="flex flex-col min-h-screen">
          <Navigation />
          <main className="flex-grow container mx-auto mt-8 px-4">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/education" element={<Education />} />
              <Route path="/lending-circle" element={<LendingCircle />} />
              <Route path="/marketplace" element={<Marketplace />} />
              <Route path="/credit-score" element={<CreditScore />} />
              <Route path="/financial-goals" element={<FinancialGoals />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
            </Routes>
          </main>
          <footer className="bg-gray-200 p-4 mt-8">
            <div className="container mx-auto text-center">
              <p>&copy; 2024 InclusiveFin. All rights reserved.</p>
            </div>
          </footer>
        </div>
      </Router>
    </AuthProvider>
  );
};

export default App;
